import logo from './logo.svg';
import React,{ useRef} from 'react';
import './App.css';
import * as pose from "@tensorflow-models/pose-detection"
import * as tf from "@tensorflow/tfjs"
import Webcam from 'react-webcam';



function App() {

  const webcamRef = useRef(null);
  const canvasRef = useRef(null);

  return (
    <div className="App">
      <header className="App-header">
        <Webcam
        ref={webcamRef}
        style={
          {
            postions:"absolute",
            marginLeft:"auto",
            marginRight:"auto",
            left: 0,
            right:0,
            textAlign:"centr",
            zIndex:9,
            width:640,
            height:480,
          }
        }
        />
        <canvas
        ref={canvasRef}
        style={{
          postion:"absolute",
          marginLeft:"auto",
          marginRight:"auto",
          left:0,
          right:0,
          textAlign:"centr",
          zIndex:9,
          width:640,
          height:480,
        }}
        />
      </header>
    </div>
  );
}

export default App;
